INSERT INTO `mangas` (`id_manga`, `titulo`, `link`, `tipo`, `status`, `sinopse`, `autor`, `artista`, `ano_lancado`, `capa`) VALUES
(48, 'Return of the Mount Hua Sect', 'return-of-the-mount-hua-sect', 'Manhwa', 'Ongoing', 'Após a sua morte numa batalha sangrenta, Chung Myung, o lendário Espadachim da Flor de Ameixa, renasce no corpo de um órfão num mundo 100 anos depois. Descobre que a sua seita, a gloriosa Seita Mount Hua, outrora uma das mais poderosas, está agora em decadência e esquecida. Com sede de justiça e desejo de restaurar a glória da sua seita, Chung Myung embarca numa jornada para reerguer a Seita Mount Hua das cinzas, enfrentando inimigos poderosos e desafiando o destino.', 'Biga', 'LICO', 2021, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1748978640/capas/php3930.jpg'),
(52, 'Superhuman Battlefield', 'superhuman-battlefield', 'Manhwa', 'Ongoing', 'O mundo foi abalado por uma guerra onde super-humanos enfrentaram monstros vindos de outras dimensões. Entre eles, Seo MoonYeop, o herói lendário, foi o responsável por salvar a humanidade.\r\nMas, após o fim da guerra, Seo MoonYeop foi injustamente esquecido e tornou-se apenas mais um rosto anónimo na multidão. Agora, com o ressurgimento das batalhas e o perigo a aumentar, ele decide regressar à arena para mostrar novamente o seu poder e provar que é, de facto, o herói mais forte do mundo.\r\nPreparem-se para uma história épica onde o combate entre super-humanos e monstros define o destino da Terra!', 'Niccolo', 'Plan A', 2022, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1749418260/capas/php5F07.png'),
(53, 'Terminally-Ill Genius Dark Knight', 'terminally-ill-genius-dark-knight', 'Manhwa', 'Ongoing', 'O protagonista é diagnosticado com uma doença terminal e tem apenas seis meses de vida. Mas, antes de morrer, ele é transportado para um jogo de realidade virtual onde assume o papel de um Cavaleiro Negro, uma das classes mais poderosas e temidas.\r\nAgora, com o tempo contado tanto na vida real como no jogo, ele decide viver sem arrependimentos, desafiando chefes, monstros e até o próprio sistema do jogo, usando a sua inteligência superior para contornar obstáculos impossíveis.\r\nCom o poder do Dark Knight e a sua mente genial, ele pretende mudar o destino, custe o que custar!', 'Jung Seon Yul', 'Nagi', 2023, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1749457163/capas/php22D3.jpg'),
(56, 'I Am the Fated Villain', 'i-am-the-fated-villain', 'Manhua', 'Ongoing', 'Gu Changge renasce num mundo de cultivo... mas como o vilão principal de uma novel! Dotado de um sistema que o guia a encarnar perfeitamente o papel de vilão, ele começa a manipular heróis e protagonistas, destruindo os seus caminhos com astúcia, charme e poder absoluto.\r\nEnquanto os outros acreditam que são os escolhidos do destino, Gu Changge move-se nas sombras, controlando os eventos e moldando o mundo à sua vontade — tudo enquanto mantém a fachada de um nobre cultivador.\r\nMas o que acontece quando o vilão deixa de seguir o guião e começa a reescrever a história?', 'Fǎn Pài Bùdà ', 'Yesman', 2021, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1749457852/capas/phpB12A.jpg'),
(57, 'Absolute Necromancer', 'absolute-necromancer', 'Manhwa', 'Ongoing', 'Hansoo Kang foi traído e assassinado por aqueles em quem mais confiava. Mas a morte não foi o fim — foi apenas o início.\r\nRenascido com o poder do necromante mais poderoso e com um sistema especial que o torna único, Hansoo regressa ao mundo com um único objetivo: vingança absoluta.\r\nCom a capacidade de reviver os mortos, controlar exércitos de esqueletos e evoluir para formas mais poderosas, ele enfrenta inimigos antigos e novos, sempre um passo à frente.\r\nNeste novo mundo, ele não será mais a vítima… será o predador supremo.', 'Chung Song', 'Ji Baekho', 2023, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1749458474/capas/php26BD.jpg'),
(58, 'The Heavenly Demon Can’t Live a Normal Life', 'the-heavenly-demon-cant-live-a-normal-life', 'Manhwa', 'Ongoing', 'Baek Joong-Hyuk, conhecido como o invencível Heavenly Demon, era o governante absoluto do Culto Celestial. Após uma traição mortal, ele desperta... no corpo de Roman Dmitri, o filho inútil de uma família nobre num mundo de espadas e magia.\r\nDeterminando-se a não repetir os erros do passado, o antigo demónio agora precisa de adaptar as suas técnicas marciais a uma nova sociedade, lidar com guerras políticas e elevar o nome Dmitri à grandeza — tudo enquanto lida com pessoas que ainda o veem como um fracassado.\r\n\r\nMas o mundo aprenderá rapidamente: não se deve subestimar um demónio reencarnado.', 'San Cheon', 'Hyeon Dong', 2021, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1749458651/capas/phpE07F.png'),
(59, 'Mercenary Enrollment', 'mercenary-enrollment', 'Manhwa', 'Hiatus', 'Yu Ijin, o único sobrevivente de um acidente de avião, viveu durante 10 anos como um mercenário de elite numa zona de guerra. Um dia, ele recebe a oportunidade de voltar à Coreia do Sul e reencontrar a sua família.\r\nMas a vida escolar comum não é tão pacífica quanto parece. A violência, bullying e ameaças àqueles que ama forçam Ijin a usar as suas habilidades letais para proteger os seus entes queridos.\r\nMesmo longe do campo de batalha, um guerreiro nunca baixa a guarda.', 'YC', 'Rak Hyun', 2020, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1749458770/capas/phpB494.jpg'),
(60, 'Academy\'s Genius Swordmaster', 'academys-genius-swordmaster', 'Manhwa', 'Ongoing', 'Ronan, um guerreiro brutal e impiedoso do passado, conhecido por massacres em nome da guerra, reencarna inesperadamente... no corpo de um jovem aluno de uma academia de magia.\r\nNesta nova vida, ele vê a oportunidade de não apenas evitar os erros do passado, mas também de dominar o mundo da magia com a sua experiência em esgrima e batalha real.\r\nCombinando os seus instintos sanguinários e conhecimento de campo com o treino académico, Ronan rapidamente se destaca como o espadachim mais temido e promissor da academia.\r\n\r\nMas antigos inimigos e novas conspirações não o deixarão em paz...', 'Seo Kwan-Do', 'Shichi', 2023, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1749458919/capas/phpF6A6.jpg'),
(63, 'I Obtained a Mythic Item', 'i-obtained-a-mythic-item', 'Manhwa', 'Ongoing', 'Num mundo onde portais se abrem e monstros invadem a Terra, apenas os Despertares podem enfrentá-los com poderes únicos.\r\nJaehyeon, um caçador de baixo nível, luta para sobreviver com os seus poucos recursos. Tudo muda quando ele obtém um Item Mítico — um artefacto lendário com poderes além da imaginação.\r\nCom esse item, Jaehyeon começa a ultrapassar os limites da humanidade, subir no ranking dos caçadores e enfrentar forças que desejam o artefacto a qualquer custo.\r\nUma nova lenda está prestes a nascer — e ele não tem intenção de parar até chegar ao topo.', 'Jeong Sunyool', 'Heth', 2022, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1749459494/capas/phpB61A.jpg'),
(64, 'Return of the SSS-Class Ranker', 'return-of-the-sss-class-ranker', 'Manhwa', 'Ongoing', 'Rokan, o mais poderoso SSS-Class Berserker do jogo Lord, foi traído e apagado pelos seus próprios aliados no auge da sua glória.\r\nMas o destino dá-lhe uma segunda oportunidade: ele acorda no passado, antes de tudo acontecer, e com as memórias completas da sua vida anterior.\r\nDesta vez, Rokan promete subir novamente ao topo — mais rápido, mais forte e mais impiedoso do que nunca.\r\nCom sede de vingança e uma vantagem absoluta no jogo, ele não deixará pedra sobre pedra até destruir aqueles que o traíram e dominar completamente o mundo de Lord.', 'Gald', 'Hojo', 2021, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1749459747/capas/php988D.jpg'),
(65, 'The Dark Magician Transmigrates After 66666 Years', 'the-dark-magician-transmigrates-after-66666-years', 'Manhwa', 'Ongoing', 'Diablo Volfir, o mais poderoso mago negro da história, foi selado pelas forças dos deuses durante uma guerra épica. 66.666 anos depois, ele desperta… no corpo de um jovem nobre fraco chamado Jamie Welton.\r\nAgora, com todo o seu poder adormecido e uma nova identidade, Diablo começa a reconstruir sua força mágica enquanto se adapta ao mundo moderno — onde a magia evoluiu, mas a corrupção continua.\r\nA sua missão? Vingança contra os deuses, recuperar a sua glória e descobrir os mistérios que surgiram durante os milénios em que esteve ausente.', 'Hwabong', 'Taru', 2021, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1749460084/capas/phpBFE4.jpg'),
(66, 'Demonic Evolution', 'demonic-evolution', 'Manhua', 'Ongoing', 'Num mundo onde demónios e humanos coexistem com dificuldades, o protagonista desperta uma habilidade única de evolução demoníaca após quase ser morto.\r\nDotado da capacidade de devorar e absorver habilidades de outros seres demoníacos, ele começa a subir na cadeia alimentar, tornando-se cada vez mais poderoso e monstruoso a cada batalha.\r\nMas quanto mais ele evolui... menos humano se torna. Será que ele vai conseguir manter a sua humanidade — ou abraçar por completo o seu lado demoníaco?', 'Unknown', 'Unknown', 2022, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1749460256/capas/php5D25.jpg'),
(67, 'Omniscient Reader’s Viewpoint', 'omniscient-readers-viewpoint', 'Manhwa', 'Ongoing', 'Durante anos, Kim Dokja foi o único leitor fiel de uma web novel obscura chamada Três Maneiras de Sobreviver ao Apocalipse. Um dia, o mundo começa a desmoronar... exatamente como descrito nessa história.\r\nSem aviso, monstros surgem, regras de um sistema aparecem, e o mundo transforma-se num jogo de sobrevivência governado por \"Constelações\".\r\nAgora, Kim Dokja é a única pessoa que conhece toda a história — mas ele não é o protagonista. Usando o seu conhecimento como leitor, ele terá de manipular eventos, formar alianças e enganar até mesmo os deuses para sobreviver.', 'Sing Shong', 'Sleepy-C (REDICE Studio)', 2020, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1749460406/capas/phpA32E.jpg'),
(69, 'Revenge of the Iron-Blooded Sword Hound', 'revenge-of-the-iron-blooded-sword-hound', 'Manhwa', 'Ongoing', 'Vikir Van Baskerville era o mais leal guerreiro do seu clã... até que foi traído e executado injustamente por aqueles que jurou proteger. Mas a morte não foi o fim — ele regressa ao passado, antes de tudo acontecer.\r\nCom as memórias de uma vida passada cheia de sofrimento e um desejo inabalável de vingança, Vikir decide mudar o seu destino.\r\nDesta vez, ele irá esmagar todos os que o traíram com a sua espada e construir o seu próprio caminho, reescrevendo a história de sangue com sangue.', 'I Stepped On Lego', 'Seol Ahrang', 2023, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1749735432/capas/php510B.jpg'),
(70, 'Second Life Ranker', 'second-life-ranker', 'Manhwa', 'Ongoing', 'Yeon-woo perde o seu irmão gémeo de forma misteriosa. Ao investigar, descobre que ele morreu enquanto participava numa misteriosa torre dimensional chamada Obelisco, onde os jogadores competem por poder.\r\nQuando Yeon-woo encontra o diário do irmão, ele decide entrar na torre — não apenas para descobrir a verdade, mas para terminar o que o seu irmão começou.\r\nMunido do conhecimento do diário e de uma sede de vingança, Yeon-woo começa a escalar a torre com um único objetivo: chegar ao topo como o Ranker mais poderoso.', 'Sa Do-Yeon', 'REDICE Studio / Dreamtoon', 2019, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1749735538/capas/phpF323.jpg'),
(71, 'Nano Machine', 'nano-machine', 'Manhwa', 'Ongoing', 'Cheon Yeo-Woon, um bastardo esquecido da Ordem Demoníaca, vive uma vida marcada por traições e desprezo. Mas tudo muda quando um misterioso descendente do futuro aparece e lhe injeta uma nanomáquina avançada.\r\nCom esta tecnologia que aumenta drasticamente as suas habilidades físicas, mentais e de combate, Yeo-Woon começa a trilhar o caminho rumo ao trono da seita demoníaca — enfrentando clãs, rivais, mestres de artes marciais e inimigos políticos, enquanto evolui mais rápido do que qualquer cultivador da sua era.\r\nEle deixará de ser um peão para se tornar o rei de todos.', 'Hanjoong Wolya', 'Indestructible', 2020, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1749735717/capas/phpA786.jpg'),
(72, 'Martial God Regressed to Level 2', 'martial-god-regressed-to-level-2', 'Manhwa', 'Ongoing', 'O lendário Deus Marcial salvou o mundo da destruição ao derrotar a ameaça final. No entanto, após a vitória, percebe que tudo o que resta é solidão... até que algo inesperado acontece: ele regressa misteriosamente no tempo ao seu nível 2, quando ainda era um guerreiro iniciante.\r\nAgora, com todo o conhecimento e habilidades da sua vida passada, ele tem uma nova chance para corrigir erros, proteger os que ama e subir novamente ao topo — mas desta vez, de forma ainda mais brutal e eficiente.\r\nUma segunda oportunidade para dominar tudo... desde o início!', 'Yeombi', 'Ah Yoongu', 2022, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1749735875/capas/php178D.jpg'),
(73, 'Solo Max-Level Newbie', 'solo-max-level-newbie', 'Manhwa', 'Ongoing', 'Jinhyuk é um streamer conhecido por jogar o jogo Tower of Trials, mas quando o jogo perde popularidade e ele se prepara para encerrar a carreira... a torre misteriosamente aparece no mundo real.\r\nO que para muitos é um apocalipse, para Jinhyuk é uma oportunidade: ele é o único jogador que conhece os segredos e estratégias de cada andar, cada boss e cada puzzle, pois foi o único a terminar o jogo no nível máximo.\r\nCom o seu conhecimento avançado e inteligência estratégica, Jinhyuk sobe a torre enquanto outros tentam apenas sobreviver — e rapidamente deixa de ser apenas um streamer para se tornar uma lenda.', 'Jang Sung-Lak', 'Swing Bat, Redice Studio', 2021, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1749736012/capas/php2BB9.png'),
(74, 'Solo Leveling', 'solo-leveling', 'Manhwa', 'Finalizado', 'Num mundo onde portais misteriosos ligam a Terra a dimensões repletas de monstros, apenas caçadores com habilidades especiais conseguem entrar e lutar.\r\nSung Jin-Woo, conhecido como o \"Caçador Mais Fraco do Mundo\", luta para sobreviver como um E-rank. No entanto, tudo muda quando ele enfrenta uma dungeon secreta e recebe uma oportunidade única: tornar-se um Jogador com a habilidade de \"subir de nível\" — algo que ninguém mais consegue fazer.\r\nCom o seu novo poder, Sung Jin-Woo começa a desafiar monstros, chefes e até outros caçadores, evoluindo de um fraco a uma lenda inigualável.', 'Chugong', 'Jang Sung-rak (REDICE Studio)', 2018, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1749736100/capas/php852F.jpg'),
(75, 'Versatile Mage', 'versatile-mage', 'Manhua', 'Finalizado', 'Mo Fan é um estudante comum, até que um dia, misteriosamente, o mundo à sua volta muda. Na nova realidade, a magia substituiu a ciência, e os magos são a elite da sociedade. Apesar de vir de uma família pobre, Mo Fan descobre que possui um talento raro: consegue controlar vários elementos mágicos, ao contrário dos outros magos que só conseguem controlar um!\r\nAgora, com a ajuda dos seus amigos, incluindo Mu Ningxue (magia de gelo) e Xu Zhaoting (magia de relâmpago), Mo Fan enfrenta monstros, inimigos poderosos e tenta sobreviver num mundo repleto de perigos mágicos, tudo enquanto luta para proteger a sua família e os seus amigos.', 'Luan (乱)', 'Domingo (哆啦)', 2016, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1749736219/capas/php58D7.jpg'),
(76, 'Warrior High School – Dungeon Raid Department', 'warrior-high-school--dungeon-raid-department', 'Manhwa', 'Hiatus', 'Num mundo onde os calabouços surgem misteriosamente, a humanidade precisa de caçadores para proteger a paz. No Warrior High School, os alunos treinam para se tornarem caçadores de elite. Entre eles, surge um jovem com um passado misterioso e um talento extraordinário para o combate. Quando monstros atacam, o Departamento de Dungeon Raid é a primeira linha de defesa, e a sobrevivência da humanidade depende do trabalho desta equipa.', 'Jo Hyunhwan (조현환)', 'Park Minseo (박민서)', 2022, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1749740750/capas/php7A58.jpg'),
(77, 'The Executioner', 'the-executioner', 'Manhwa', 'Ongoing', 'Num mundo dominado por crime, corrupção e impunidade, um sistema secreto emerge com uma nova ordem de justiça: os executores.\r\nEstes agentes especiais são encarregados de eliminar criminosos perigosos que escapam à justiça tradicional.\r\nO protagonista, um executor com um passado sombrio, luta com os seus próprios demónios enquanto aplica a lei com mão de ferro — onde a moralidade é constantemente posta à prova.\r\nMas quando uma conspiração interna ameaça virar todo o sistema contra ele, ele terá de descobrir quem são os verdadeiros inimigos… e se vale a pena continuar a matar pelo “bem maior”.', 'Lee Jehwan', 'Park Bumjin', 2023, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1749746463/capas/phpA517.jpg'),
(78, 'Return of the Frozen Player', 'return-of-the-frozen-player', 'Manhwa', 'Ongoing', 'Cinco anos após o início da invasão dos “Ice Queen” e do colapso da Terra, Seo Jun-ho, o mais forte dos jogadores conhecidos como “Caçadores”, sacrifica-se para derrotar a Rainha do Gelo e salvar o mundo.\r\n\r\nMas... ele não morreu.\r\nJun-ho acorda 25 anos depois, num mundo em que a sua lenda virou passado esquecido — e novas ameaças, ainda mais terríveis, surgem.\r\nAgora, com o seu corpo a recuperar lentamente e um sistema misterioso a guiá-lo, Jun-ho decide voltar ao topo. Só que desta vez, ele não será apenas um herói... será um vingador silencioso.', 'Jerry M', 'Inus', 2020, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1749753366/capas/phpFAF8.png'),
(79, 'The Blink of a Genius Mage ou Magic Academy’s Genius Blinker', 'the-blink-of-a-genius-mage-ou-magic-academys-genius-blinker', 'Manhwa', 'Ongoing', 'Shion, um génio nascido sem talento mágico, é constantemente ridicularizado na Academia de Magia.\r\nNo entanto, tudo muda quando ele descobre uma forma secreta de magia baseada em \"Blink\" (teletransporte) — e torna-se o primeiro mago a dominar por completo essa arte.\r\nCombinando estratégia, velocidade e inteligência, Shion transforma uma habilidade considerada inútil num poder devastador.\r\nA sua ascensão meteórica começa a abalar a hierarquia mágica, e ele passa a ser temido tanto por aliados quanto por inimigos.', 'Kim Chulwoo', 'Seung-Yeon', 2023, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1749838081/capas/php15F5_xzsgiq.webp'),
(80, 'Leveling With the Gods', 'leveling-with-the-gods', 'Manhwa', 'Ongoing', 'Kim Yuwon era um guerreiro lendário que participou na grande guerra dos deuses contra os monstros que ameaçavam o mundo.\r\nApesar de tudo, falhou.\r\nMas os deuses concedem-lhe uma oportunidade de regressar ao passado — com o conhecimento, experiência e poderes da sua vida anterior.\r\nCom uma segunda chance, ele começa a subir a Torre dos Desafios novamente, enfrentando seres mitológicos, constelações e chefes implacáveis... desta vez, para mudar o destino do mundo.', 'Black Ajin', 'Oh Hyun', 2021, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1749835139/capas/php2F6A_aslr44.jpg'),
(81, 'The Extra’s Academy Survival Guide', 'the-extras-academy-survival-guide', 'Manhwa', 'Ongoing', 'Um programador normal acorda e descobre que reencarnou dentro do seu próprio romance... mas como um mero extra, um figurante completamente irrelevante!\r\nSem habilidades especiais, sem “cheat”, e sem papel no enredo principal, ele sabe que o mundo do romance é cruel, cheio de personagens overpower, monstros e eventos apocalípticos.\r\nPara sobreviver, ele começa a aplicar todo o conhecimento que tem da história original e das mecânicas do mundo, com um único objetivo: não morrer.\r\nEle escreve o seu próprio guia de sobrevivência, mesmo sem ser herói ou vilão — só mais um “extra” a tentar enganar o destino.', 'Corta', 'Green', 2023, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1749837222/capas/phpF151_dj7wfs.png'),
(82, 'The Reincarnated Assassin is a Genius Swordsman', 'the-reincarnated-assassin-is-a-genius-swordsman', 'Manhwa', 'Ongoing', 'Raon, um assassino de elite que viveu numa organização brutal onde matar era rotina, é traído e morto…\r\nMas em vez de morrer para sempre, ele renasce como o filho fraco e ignorado da nobre família Sieghart — uma das mais poderosas do império.\r\nApesar da sua nova vida, Raon mantém todas as memórias e habilidades da vida passada.\r\nDecidido a viver como uma espada, ele começa a treinar com determinação brutal, escondendo o seu verdadeiro passado enquanto sobe como um génio do espadachim.\r\nÀ sua volta surgem aliados improváveis (como um espírito mágico em forma de gato azul) e inimigos que jamais suspeitam do verdadeiro monstro que estão a provocar…', 'Haeon Ju', 'Perugia', 2022, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1749837840/capas/php6168_tvzxkc.jpg'),
(83, 'The Max-Level Player’s 100th Regression', 'the-max-level-players-100th-regression', 'Manhwa', 'Hiatus', 'Yuma, o jogador mais forte do mundo, chega ao final da torre após inúmeras mortes e regressões... 99 vezes.\r\nCada vez que falhava, o sistema reiniciava tudo — mas mantinha as suas memórias e conhecimento.\r\nAgora, na 100ª regressão, Yuma decide abandonar as abordagens tradicionais e fazer tudo de forma imprevisível — mesmo que isso signifique trair aliados, desafiar os próprios deuses ou alterar as regras do sistema.\r\nSe ele falhar desta vez, será o fim permanente... mas se vencer, poderá libertar o mundo da torre amaldiçoada.', 'Jukharu (죽하루)', 'Kim Yoon', 2023, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1749837350/capas/phpEB9C_tbdgd5.jpg'),
(84, 'The Player Who Returned 10,000 Years Later', 'the-player-who-returned-10000-years-later', 'Manhwa', 'Ongoing', 'Kangwoo era um ser humano comum... até cair no inferno.\r\nDurante 10.000 anos, sobreviveu no Abismo — o inferno mais profundo e caótico que existe — onde lutou, matou e evoluiu constantemente até se tornar um ser além da compreensão.\r\nAgora, ele regressa ao mundo humano com um único objetivo: viver uma vida normal.\r\nMas com tanto poder contido e um sistema de níveis ativo, a paz será difícil...\r\nEspecialmente quando demónios, anjos e entidades cósmicas começam a notar o seu regresso.', 'Butterfly Valley', 'Heater', 2022, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1749837289/capas/phpBE_hrgzxe.webp'),
(85, 'Pick Me Up, Infinite Gacha', 'pick-me-up-infinite-gacha', 'Manhwa', 'Ongoing', 'Han era apenas um jogador casual do jogo mobile Pick Me Up — até ser invocado para dentro do próprio jogo como um personagem.\r\nAgora transformado num herói de raridade comum (3★), Han deve sobreviver num mundo onde os jogadores invocadores controlam os heróis como peões e os descartam quando deixam de ser úteis.\r\nDeterminando-se a não ser descartado, Han começa a subir de nível à força, dominar habilidades inesperadas e manipular o próprio sistema de gacha para mudar o seu destino.\r\nMas... e se ele descobrir que os jogadores são tão prisioneiros quanto os heróis?', 'Lucks', 'Yoon Jaeho', 2022, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1749835395/capas/php1289_le0ut2.jpg'),
(86, 'Regressing as the Reincarnated Bastard of the Sword Clan', 'regressing-as-the-reincarnated-bastard-of-the-sword-clan', 'Manhwa', 'Ongoing', 'Nascido como um bastardo rejeitado dentro do prestigiado Clã dos Espadachins, o protagonista Casein von Britten viveu uma vida miserável, sendo constantemente humilhado pelos seus meio-irmãos e ignorado pelos anciãos.\r\nApós uma série de eventos trágicos, ele morre injustamente…\r\nMas surpreendentemente, renasce no passado — antes de todos os erros e humilhações — com todas as suas memórias intactas.\r\nAgora, com o conhecimento do futuro e a frieza de quem já sofreu o suficiente, Casein está decidido a subir ao topo da hierarquia, transformar o clã com os seus próprios métodos, e esmagar aqueles que o desprezaram.', 'Mead-Eating Squirrel', 'Next Level Studio', 2023, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1749834142/capas/phpF7D4_nu3aji.png'),
(87, 'Duke Pendragon', 'duke-pendragon', 'Manhwa', 'Finalizado', 'Raven Valt, outrora um cavaleiro leal, foi traído e condenado injustamente. Como punição, é enviado para lutar como um soldado suicida na fronteira — uma sentença de morte disfarçada.\r\nMas o destino intervém. No momento da sua morte, ele reencarna no corpo de Alan Pendragon, herdeiro da lendária Casa Pendragon, ligada aos dragões e conhecida por sua linhagem mítica.\r\nCom um novo nome, novas habilidades e os segredos do passado ainda frescos na memória, Raven (agora Alan) começa a construir o seu império — não apenas para vingar-se, mas para forjar uma nova era com os dragões ao seu lado.', 'Kim Hyun Woo', 'FUREDO & FRO7', 2022, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1749834689/capas/php4E8C_k4nmse.jpg'),
(88, 'The Regressed Son of a Duke is an Assassin', 'the-regressed-son-of-a-duke-is-an-assassin', 'Manhwa', 'Ongoing', 'Nascido como o filho bastardo de um duque, o protagonista viveu uma vida de abuso e negligência dentro da casa nobre. Eventualmente traído e morto, ele regressa ao passado com todas as suas memórias intactas.\r\nDesta vez, no entanto, ele não será uma vítima.\r\nCom o conhecimento adquirido como assassino de elite antes da sua morte, ele começa a manipular, eliminar e dominar os seus inimigos um por um — tanto dentro como fora da família.\r\nAgora, com habilidades afiadas e uma nova frieza, o filho renegado do duque está determinado a mudar o seu destino com sangue e estratégia.', 'Covan Lee', 'Jeonghoon', 2023, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1749836671/capas/php91A1_ham7y2.png'),
(89, 'The Beginning After the End', 'the-beginning-after-the-end', 'Manhwa', 'Ongoing', 'No seu mundo anterior, Rei Grey era o ser mais poderoso do planeta. Mestre em artes marciais, magias e estratégias, ele dominava tudo… mas era vazio por dentro.\r\nApós morrer de forma misteriosa, ele renasce como Arthur Leywin, num mundo onde magia, monstros e reinos coexistem.\r\nDesta vez, ele tem uma família, uma infância — e uma nova oportunidade para viver não como rei, mas como pessoa.\r\nPorém, à medida que cresce, Arthur percebe que as forças sombrias que destruíram o seu mundo anterior também ameaçam este novo universo… e ele pode ser a chave para impedi-las.', 'TurtleMe', 'Fuyuki23 (primeiras seasons), agora Estúdio Redice', 2018, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1749755031/capas/php6B58.jpg'),
(90, 'Absolute Regression', 'absolute-regression', 'Manhwa', 'Ongoing', 'Han Yujin viveu a pior das vidas num mundo onde os fracos são usados como escudos e os fortes governam sem piedade.\r\nTorturado, traído e sacrificado — tudo para que outros sobrevivessem.\r\nMas quando a sua vida termina… ele volta ao passado, para o início de tudo, com a memória clara da crueldade futura.\r\nDesta vez, nada o impedirá.\r\nCom a dor como guia e um sistema que acompanha o seu crescimento, Yujin começa a forjar o seu caminho — com sangue, força e uma mente fria. A regressão é a sua arma. E a vingança, o seu destino.', 'Bi', 'Park Jin Hwan', 2023, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1749834649/capas/phpB289_dut3cf.jpg');
